Today on @wornandwound, I launched a new podcast series called Changing Gears. A few times a month, I’ll be sitting down with folks like photographers, gear brand owners, adventurers, and designers to talk about our love for all things gear related. It’ll also be a space for me to review the awesome cameras I get hands-on with on the regular. First episode is up and I talk to my bestest colleague @kyality as well as review the latest medium format camera from @fujifilmx_us! 

Let me know what you think in the comments! Appreciate y’all! 




